const DeviceInfo=()=>{const n={getWindowInnerWidth:()=>window.innerWidth||"undefined",getWindowInnerHeight:()=>window.innerHeight||"undefined",setWindowInnerDimension:()=>{const e=document.getElementById("window-inner-dimension");return null!==e?(e.lastElementChild.innerHTML=`${n.getWindowInnerWidth()}x${n.getWindowInnerHeight()}`,!0):(console.error("#window-inner-dimension is not a DOM element"),!1)},getWindowOuterWidth:()=>window.outerWidth||"undefined",getWindowOuterHeight:()=>window.outerHeight||"undefined",setWindowOuterDimension:()=>{const e=document.getElementById("window-outer-dimension");return null!==e?(e.lastElementChild.innerHTML=`${n.getWindowOuterWidth()}x${n.getWindowOuterHeight()}`,!0):(console.error("#window-outer-dimension is not a DOM element"),!1)},getWindowMaxWidth:()=>window.screen.availWidth||"undefined",getWindowMaxHeight:()=>window.screen.availHeight||"undefined",setWindowMaxDimension:()=>{const e=document.getElementById("window-max-dimension");return null!==e?(e.lastElementChild.innerHTML=`${n.getWindowMaxWidth()}x${n.getWindowMaxHeight()}`,!0):(console.error("#window-max-dimension is not a DOM element"),!1)},getWindowSize:()=>{let e="";e=window.fullScreen?"Fullscreen":n.getWindowOuterWidth()===window.screen.availWidth&&n.getWindowOuterHeight()===window.screen.availHeight?"Maximized":160===n.getWindowOuterWidth()&&28===n.getWindowOuterHeight()?"Minimized":"Restored";return e},setWindowSize:()=>{const e=document.getElementById("window-size");return null!==e?(e.lastElementChild.innerHTML=`${n.getWindowSize()}`,!0):(console.error("#window-size is not a DOM element"),!1)}};const e=()=>{n.setWindowInnerDimension();n.setWindowOuterDimension();n.setWindowMaxDimension();n.setWindowSize()};return{execute:e,win:n}},di=DeviceInfo();di.execute();